import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <nav className="navbar">
      <h1>Ankur</h1>
      <div>
        <ul className="nav-items">
          <li>
            <a href="/work">Work</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/contact">Contacts</a>
          </li>
        </ul>
      </div>
    </nav>
  );
}

export default Nav;
